import React from "react";
import './index.css'
export const NavBar = () => {
  return (
    <div className="navDiv">
      <nav className='nav'>
        <a>Home</a>
        <a>Main</a>
        <a>About us</a>
        <a>Contacts</a>
        <button className="nav__bt">Log out</button>
      </nav>
    </div>
  );
};
